import mongoose from 'mongoose';

const DhtSchema = new mongoose.Schema({
    hum: {
        type: Number,
        required: true,
        default: 0
    }, // 온도
    tmp: {
        type: Number,
        required: true,
        default: 0
    }, // 습도
    measuredAt: { // 측정시간
        type: Date,
        default: Date.now
    },
    controller: { // 사용 유저
        type: mongoose.Schema.Types.ObjectId,
        required: true,
        ref: "User"
    },
    product: { // 제품 번호
